#include<unordered_map>
#include<vector>
#include<iostream>

using namespace std;

class Solution {
public:
    string minWindow(string s, string t) {
        unordered_map<char, int> m;
        int count = 0;
        
        for(int i=0; i<t.length();i++) {
            m[t[i]] = m[t[i]] + 1;
        }

        count = m.size();

        int left=0;
        int right=-1;

        int highest_len = s.length();
        
        int str_s=0, str_len=0;

        while((left<s.length()) && (right<(int)s.length())) {

            if(count==0) {
                if((right-left+1)<=highest_len) {
                    highest_len=right-left+1;
                    str_s=left;
                    str_len=highest_len;
                }

                if(m.find(s[left]) != m.end()){
                    if(m[s[left]]==0) {
                        count++;
                    }

                    m[s[left]] += 1;
                }


                left++;
            } else {
                right++;

                if(m.find(s[right]) != m.end()){
                    m[s[right]] -= 1;

                    if(m[s[right]]==0) {
                        count--;
                    }
                }
            }
        }
        
        return s.substr(str_s, str_len);
    }
};


int main() {
    Solution s;

    cout << s.minWindow("", "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ") << endl;
    return 0;
}